import React from "react";
import classes from './Post.module.css'

const Post = (props) => {
    return <div className={classes.item}>
        <img
            src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcR2_TRfBLeLipIfU1Dk0ctEVM7i-p-vCBv5Og&usqp=CAU"
            alt="avatar"/>
        {props.message}
        <div className={classes.like}>
            <img src="https://img.pngio.com/light-blue-light-blue-heart-clip-art-heart-light-cliparts-png-blue-heart-transparent-background-900_560.jpg" alt="LIKE"/>
            <span>{props.like}</span>
        </div>
    </div>

}
export default Post;
